import '../index.css';

export default function About() {
  return (
    <>
      <HorizontalLine />

      <ul className="flex justify-center mt-5 mb-20 space-x-5">
        <li> <Instagram /> </li>
        <li> <Twitter /> </li>
        <li> <LinkedIn /> </li>
        <li> <GitHub /></li>
      </ul>

    </>

  );
}
